import { Button } from 'antd';
import { getAllOrders } from '../../client';
import { useCallback, useEffect, useState } from 'react';
const Home =  () => {
  const [data , setData] = useState("");
   
  const getData = useCallback(() => {
        getAllOrders()
        .then((res) => {
          const convertData  = res.data.content.map((data) => {
            const {
              orderId,
              customerId,
              employeeId,
              orderDate,
              shipName,
              shipAddress,
            } = data;
            return {
              key: orderId,
              orderId,
              customerId,
              employeeId,
              orderDate,
              shipName,
              shipAddress,
            };
          });
          setData(convertData);
        }).catch((error) => {
          console.log(error);
        });
  });
  useEffect(() => {
		getData();
	}, [getData]);
  

  return (
    <>
      <Button type="primary">Primary Button</Button>
    </>
  );
};

export default Home;
